import { Avatar, Grid, ImageList, ImageListItem } from "@mui/material";
import React from "react";
import { Box } from "@mui/system";
import image from "../assets/akash.jpg";
import styles from "./profilepage.module.css";
import CompanyName from "../assets/instawhite.png";

const Profilepage = () => {
  const itemData = [
    {
      img: "https://images.unsplash.com/photo-1551963831-b3b1ca40c98e",
      title: "Breakfast",
    },
    {
      img: "https://images.unsplash.com/photo-1551782450-a2132b4ba21d",
      title: "Burger",
    },
    {
      img: "https://images.unsplash.com/photo-1522770179533-24471fcdba45",
      title: "Camera",
    },
    {
      img: "https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c",
      title: "Coffee",
    },
    {
      img: "https://images.unsplash.com/photo-1533827432537-70133748f5c8",
      title: "Hats",
    },
    {
      img: "https://images.unsplash.com/photo-1558642452-9d2a7deb7f62",
      title: "Honey",
    },
    {
      img: "https://images.unsplash.com/photo-1516802273409-68526ee1bdd6",
      title: "Basketball",
    },
    {
      img: "https://images.unsplash.com/photo-1518756131217-31eb79b20e8f",
      title: "Fern",
    },
    {
      img: "https://images.unsplash.com/photo-1597645587822-e99fa5d45d25",
      title: "Mushrooms",
    },
    {
      img: "https://images.unsplash.com/photo-1567306301408-9b74779a11af",
      title: "Tomato basil",
    },
    {
      img: "https://images.unsplash.com/photo-1471357674240-e1a485acb3e1",
      title: "Sea star",
    },
    {
      img: "https://images.unsplash.com/photo-1589118949245-7d38baf380d6",
      title: "Bike",
    },
  ];
  return (
    <div className={styles.main}>
      <div>
        <div className={styles.profile}>
          <div className={styles.picture}>
            {" "}
            <Avatar
              className={styles.Avatar}
              alt="Remy Sharp"
              sx={{ width: 63, height: 63 }}
              src={image}
            />
          </div>
          <div className={styles.details}>
            <h2 className={styles.username}>Siddharth Patel</h2>
            <div>
            <h6 >Siddharthnhjbhvhgvghvh Patel 99% coffeeðŸ˜‰</h6>
            </div>
            <h6 className={styles.userdetails}>10 posts &nbsp;</h6>
            <h6 className={styles.userdetails}>10 followers &nbsp;</h6>
            <h6 className={styles.userdetails}>10 following &nbsp;</h6>
          </div>
        </div>
        <ImageList
          sx={{ width: "100%", height: "100%", pt: 0, mt: 0 }}
          cols={3}
          rowHeight={164}
        >
          {itemData.map((item) => (
            <ImageListItem key={item.img}>
              <img
                src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                alt={item.title}
                loading="lazy"
              />
            </ImageListItem>
          ))}
        </ImageList>
      </div>
    </div>
  );
};

export default Profilepage;
